import React,{useState,useEffect} from 'react'
import Fetch from './Fetch'

function Data() {


const [data,setdata]=useState([])


useEffect(()=>{
    fetchdata()
},[])


async function fetchdata()
{
    await Fetch.getdata().then(res=>{
        alert(JSON.stringify(res))
        setdata(res)
    })
    .catch((err)=>{console.log(err)})
}

  return (
    <div>
        {console.log(data)}
    </div>
  )
}

export default Data
